import React from 'react';
import styled from 'styled-components';

const SHome = styled.div`
  height: 100%;
`;

const TopBanner = styled.div`
  width: 97%;
`;
const LeftTopBanner = styled.div`
  height: 30%;
  width: 70%;
  float: left;
`;
const RightTopBanner = styled.div`
  display: inline-block;
  height: 30%;
  width: 29%;
`;

const Home = () => {
  return (
    <SHome>
      <TopBanner>
        <LeftTopBanner>
          <div>Banner1</div>
          <div>Banner2</div>
          <div>Banner3</div>
        </LeftTopBanner>
        <RightTopBanner>Banner4</RightTopBanner>
      </TopBanner>
    </SHome>
  );
};

Home.getInitialProps = async context => {
  return true;
};

export default Home;
